import { Link } from 'react-router-dom';
import logo from '../../assets/images/Logo.png';
import styles from './Header.module.css';

export const Header = () => {
    return (
        <header className={styles.header}>
            <div className={styles.logo}>
                <img src={logo} alt="" className={styles["logo-img"]} />
            </div>

            <nav className={styles['nav-desctop']}>
                <ul className={styles["nav-list"]}>
                    {/* <li className={styles["nav-list-item"]}><Link to='/movies'>Movies</Link></li>
                    <li className={styles["nav-list-item"]}><Link to='/series'>Series</Link></li>
                    <li className={styles["nav-list-item"]}><Link to='/genres'>Genres</Link></li>
                    <li className={styles["nav-list-item"]}><Link to='/login'>Login</Link></li>
                    <li className={styles["nav-list-item"]}><Link to='/register'>Register</Link></li> */}
                </ul>
            </nav>

        </header>
    )
}
